दुबई अन्तर्राष्ट्रिय रंगशालामा १४७ रनको लक्ष्य पछ्याएको यूएई १७.५ ओभरमा १०५ रनमा अलआउट भयो । राहुल चोपडाले सर्वाधिक ३५ रन बनाए । शाहिन शाह अफ्रिदी, हरिस रौफ र अबरार अहमदले दुई-दुई विकेट लिए ।

